import React, { useEffect } from "react";

interface IProps {
  list: Array<{
    id: number;
    name: string;
    checked: boolean;
  }>;
  loadList: () => void;
}

const List = ({ list, loadList }: IProps) => {
  useEffect(() => {
    loadList();
  }, [loadList]);
  console.log(`list`, list);
  return (
    <div>
      {list.map((item) => (
        <div>
            <div>
                {item.id}
            </div>
            <div>
                {item.name}
            </div>
            <div></div>
        </div>
      ))}
    </div>
  );
};

export default List;
